import React from 'react';
import ReactDOM from 'react-dom';
import './index.scss';
import App from './App';
import Calc from './components/calculator/calc';
import Greeting from './components/greeting/greeting';

import Recipe from './components/recipe/recipe';
import Shopping from './components/shopping_list/shopping';
import Todo from './components/todo_list/todo';
import * as serviceWorker from './serviceWorker';
import './nav.scss';

let page = <Greeting />;

function Nav() {
	function recipe(e) {
		e.preventDefault();
		alert('Recipe Search');
		let page = 'Recipe';
	}
	function calc(e) {
		e.preventDefault();
		alert('Calculator App');
	}
	function todo(e) {
		e.preventDefault();
		alert('Todo List');
	}
	function shop(e) {
		e.preventDefault();
		alert('Shopping List');
	}
	function home(e) {
		e.preventDefault();
		alert('Home Page');
	}

	return (
		<div className='nav'>
			<i onClick={recipe} className='fas fa-utensils fa-2x'></i>
			<i onClick={calc} className='fas fa-calculator fa-2x'></i>
			<i onClick={todo} className='fas fa-list fa-2x'></i>
			<i onClick={shop} className='fas fa-shopping-cart fa-2x'></i>
			<i onClick={home} className='fas fa-home fa-4x'></i>
		</div>
	);
}

ReactDOM.render(
	<React.StrictMode>
		{page}
		<Calc />
		<App />
		<Recipe />
		<Shopping />
		<Todo />
		<Nav />
	</React.StrictMode>,
	document.getElementById('root')
);

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
